import React from "react";

import Hamburger from "./Hamburger";
import Menu from "./Menu";
import "./HeaderMobile.css";

const Header = props => {
	return (
		<header className="mobile flex f-col jc-start">
			<Hamburger />
			<Menu />
		</header>
	);
};

export default Header;
